import React from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';

import './styles/header.css';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

root.render(
  <React.StrictMode>
      <div className='container'>
          <App />
      </div>

  </React.StrictMode>
);
